import React from 'react';
import {Pagination} from "react-bootstrap";


function Pages() {
    return (
        <Pagination>
            <Pagination.First />
            <Pagination.Prev />

            <Pagination.Item>{11}</Pagination.Item>
            <Pagination.Item>{12}</Pagination.Item>
            <Pagination.Item>{13}</Pagination.Item>

            <Pagination.Next />
            <Pagination.Last />
        </Pagination>
    );
}

export default Pages;
